&lt;p style=&quot;text-align: justify;&quot;&gt;Посещение действующей мечети Ходжа Илгор, которая была возведена в конце 19 века на месте одноимённого древнего кладбища. Территория мечети засажена многолетними чинарами, карагачами, ивами, которые создают приятную обстановку и живописный пейзаж.&nbsp; &nbsp; &nbsp; &nbsp;&lt;/p&gt;
